import React from "react";

const NotesFields = () => {
  const {id} = useParams
  return (
    <div className="card-notes card">
      <div className="card-title">Event notes</div>
      <Link to="/create-note/:id" className="card-link">Add new notes</Link>
    </div>
  );
};

export default NotesFields;
